/*Table structure for table `t_leadspeak_store` */

DROP TABLE IF EXISTS `t_leadspeak_store`;

CREATE TABLE `t_leadspeak_store` (
  `ID` varchar(32) NOT NULL,
  `ACTION` varchar(2) DEFAULT NULL,
  `CENTENT` longtext,
  `CREATE_DATE` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `DID` varchar(60) DEFAULT NULL,
  `MEETING_NAME` varchar(60) DEFAULT NULL,
  `OID` varchar(60) DEFAULT NULL,
  `SECRET_RANK` varchar(60) DEFAULT NULL,
  `TIME` date DEFAULT NULL,
  `TITLE` varchar(60) DEFAULT NULL,
  `UID` varchar(60) DEFAULT NULL,
  `INFOTYPEID` varchar(32) DEFAULT NULL,
  `INVOLVED_IN_THE_FIELD` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK6F3E032D53C1D95A` (`INFOTYPEID`),
  KEY `FK6F3E032DEA48F061` (`INVOLVED_IN_THE_FIELD`),
  CONSTRAINT `FK6F3E032D53C1D95A` FOREIGN KEY (`INFOTYPEID`) REFERENCES `t_info_type` (`ID`),
  CONSTRAINT `FK6F3E032DEA48F061` FOREIGN KEY (`INVOLVED_IN_THE_FIELD`) REFERENCES `t_info_type` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

